import React from "react";
import "./characters.css"

const Characters = ({ characters, isFetching}) => {
    return isFetching ? <h2>Loading...</h2> : <div className={"cards"}>
            {characters.map(item => {
                <h2>{item.name}</h2>
            })}
        </div>
};

export default Characters;
